        <div className={c.dialog}>
            {props.name}
        </div>
    );
}

const Message = (props) => {
    return(
    <div className = {c.dialog}>{props.msg}</div>
    );
}

const Dialogs = () => {

let dialogsData = [
    {id: 1, name:"Danon"},
